"""# Mecari nilai rata - rata"""


def mencari_nilai_rata(data, rata):
  for i in range(len(data)):
    rata.append(st.mean(data[i]))


"""# Similarity
![unknown.png](data:image/png;base64,)


"""


def rumus_similarity(user, data, nilairata, arrsim):
    for j in range(len(user)-1):
        rumus_atas = 0
        rumus_bawah = 0
        akar_bagian1 = 0
        akar_bagian2 = 0
        ratauser = st.mean(user)
        for i in range(len(user)):
          rumus_atas += (user[i]-ratauser)*(data[j][i]-nilairata[j])
          akar_bagian1 += (user[i]-ratauser)**2
          akar_bagian2 += (data[j][i]-nilairata[j])**2
        rumus_bawah = (math.sqrt(akar_bagian1))*(math.sqrt(akar_bagian2))
        arrsim.append(rumus_atas/rumus_bawah)


"""# Prediksi
![unknown.png](data:image/png;base64,)
"""


def persamaan_nilai(n, rata):
    for j in range(len(rata)):
        if n == rata[j]:
            return j


def rumus_prediksi(rate, total, mean, data):
    similar = []
    nilai_atas = 0
    nilai_bawah = 0
    for i in range(int(total)):
        similar.append([])
        similar[i].append(rate[i])
        similar[i].append(mean[i])
    similar.sort(reverse=True)
    for i in range(2):
        nilai_atas += similar[i][0] * \
            (data[persamaan_nilai(similar[i][1], mean)][4]-similar[i][1])
        nilai_bawah += similar[i][0]
    return rate[-1]+(nilai_atas/nilai_bawah)


